/**
 * Footer Component
 */
import React from 'react';
import '../../App.scss';

const FooterComponent = () => {
    return (
        <footer className="site-footer">
            <div className="container">
                <div className="row">
                    <div className="col-md-8 col-sm-6 col-xs-12">
                        <p className="copyright-text">PantryTrak by Mark H. Mollenkopf is licensed under a Creative Commons Attribution-ShareAlike 3.0 Unported License.</p>
                    </div>
                </div>
            </div>
        </footer>
    )
};

export default FooterComponent ;
